import "./homepage.css"
import Nav from "../../Nav/Nav"
const Homepage = ({setLoginUser}) => {
    return (
        <div className="homepage">
            <Nav/>
            <div className="button" onClick={() => setLoginUser({})} >Logout</div>
        </div>
    )
}

export default Homepage
